import {StyleSheet , Dimensions} from 'react-native'

const windowHeight = Dimensions.get('window').height;

const stylesModal = StyleSheet.create({
    container: {
        display:'flex',
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
    },
    modalContainer: {
        display:'flex',
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: 'rgba(0, 0, 0, 0.5)',
    },
    modalContent: {
      display:'flex',
      backgroundColor: 'white',
      padding: 20,
      width: '80%',
      alignItems: 'center',
    },

    modalButtonConteir:{
        display:'flex',
        flexDirection:'row'
    },

    modalButtons:{
        display:'flex',
        alignItems:'center',
        backgroundColor:'grey',
        borderWidth:1,
        width:'55%',
        height:windowHeight*0.0,
    },


});

export default stylesModal;
